Before I say anything else, a little PSA;
📣Get yourself wristbands for when you wash your face!! It’s a GAMECHANGER! Keeps the water from running down your arms. you’ll thank me later. I’ll link the ones I have in my stories. 📣

I have a love/hate relationship with washing my face every night but I haven’t skipped washing my face in probably 6 years! It’s SUCH a process but man I LOVE relaxing at home with a clean, fresh face.🤌🏼 If my makeup is on I feel like I can’t fully unwind 🤪so if I know I’m going to be home for the rest of the day, as soon as I get home I’ll immediately wash my face! You too? Or do you wash your face only right before bed? 

This is my current nighttime routine with zero edit or filter because #realskin 🙃;
(some have been longtime favourite and some are new-to-me but recommended over + over again!) 

@elemis - Pro Collagen cleansing balm (melts makeup away!)
@trulylifestylebrand - facial cleanser (yes, I double cleanse!)
@trulylifestylebrand - Witch hazel toner spray 
@trulylifestylebrand - Ageless 1% retinol serum
@zoskinhealth.canada - Pigment control crème 
@tatcha - The Dewy Skin Cream
@olehenriksen - Banana Bright+ Eye Crème

